      <div style={{display:'flex', alignItems:'center', gap:12}}>
        <img src="" alt="logo" style={{width:42, height:42, borderRadius:8}} />
        <div>
          <div style={{fontWeight:700}}>AgriSmartAI</div>
          <small>AI assistant for farmers</small>
        </div>
      </div>
      <div>
        <a href="#" style={{marginRight:10}}>Docs</a>
        <a href="#">Contact</a>
      </div>
    </div>
  );
}
